import React, {Component} from "react"
import UserTableRow from "./UserTableRow"



    
const UserTable = ({ users }) => {
    return (
        <table id="customers">
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Email</th>
                    <th>accessLevel</th>
                    <th>PFP</th>
                    <th>delete</th>
                    </tr>
            </thead>
            <tbody>
                {users.map(user => (<UserTableRow key={user._id} user={user} />
                ))}
            </tbody>
        </table>
    );
};

export default UserTable;
